import { getPokemonBase} from "../Store/action";
import { useEffect,useState } from "react";
import { useDispatch,useSelector} from "react-redux";
import PokemonCard from "./PokemonCard";

export default function MyTeam() {
    const teamPokemon =useSelector(store =>store.pokemon.team)
    const [state, setstate] = useState([])
    const dispatch=useDispatch();
    const img=fetch('https://tenor.com/es-US/view/pokemon-gif-24403522')
    .then(res => res.json)
    .then(data=>data)
    useEffect(() => {
        
       
        setstate(teamPokemon)
        dispatch(getPokemonBase())
       
      },[]);
  return (
     <>
     <br/>
     <br/>
     <br/>
      {
        state&&
        state.map((e)=><PokemonCard key={e.id}
         name={e.name}
         image={img}
        />)
               
      }
     
     
     
     
     </>
    
  )
}
